import {GiLoveHowl} from 'react-icons/gi';
import {classes} from './Footer.module.css';
function Footer(){
    return(
        <footer>
            <h3>Made with br /><GiLoveHowl size='2em'/>
            <br />by <br/> <span>Veera Teja & R</span></h3>
        </footer>
    );
}
export default Footer;
